import "./App.css";
import {
  Avatar,
  Container,
  Flex,
  MenuButton,
  MenuItem,
  MenuList,
} from "@chakra-ui/react";
import Navbar from "./Navigation/Navbar";

function App() {
  return (
    <Container>
      <Flex>
        <Navbar />
        <MenuButton>
          <Avatar />
        </MenuButton>
        <MenuList>
          <MenuItem>Profile</MenuItem>
          <MenuItem>Sttings</MenuItem>
        </MenuList>
      </Flex>
    </Container>
  );
}

export default App;
